import './App.css';
import Header from "./components/Header.js"
import Footer from "./components/Footer.js"
import Content from "./components/Content.js"

function App() {
  return (
    <div>
      <Header/>
      <img src="https://studio.youtube.com/channel/UCrGMI1P1PmL0hmKlKeNvKqQ/editing/images" alt="Curious Grids Banner"></img>
      <Content/>
      <Footer/>
    </div>
  );
}

export default App;
